import React, {Component} from 'react';

class Like extends Component {
    render() {
        let someClass;
        if(this.props.liked)someClass="far fa-heart";
        else someClass="fas fa-heart";
        return (
            <i className={someClass}/>
        );
    }
}

export default Like;
